import "./Concept.css";
function Concept(props) {
  return (
    <div>
      <img src={props.concept.image} alt={props.concept.title} />
      <h2>{props.concept.title}</h2>
      <p>{props.concept.description}</p>
    </div>
  );
}
export default Concept;
